def RemoveDup(my_str):
	new_str=""
	my_list = my_str.split("/")
	new_list = []
	for item in my_list:
		if item not in new_list:
			new_list.append(item)
	
	

	for item in new_list:
		new_str = new_str+"/"+item
	#print new_str
	return new_str[2:]

